// Default imports
import React, {Component} from 'react';

// Custom imports
import {NavLink} from "react-router-dom";
import './navbar.css';
import M from 'materialize-css/dist/js/materialize.min.js';
import {MdHome, MdInfo, MdWork, MdPhone, MdMenu} from 'react-icons/md';
import {connect} from 'react-redux';
import * as personalInfo from '../../actions/action';
import axios from 'axios';
import {GetPersonalInfo} from "../../actions/action";

class Nav extends Component {
    // Form load
    componentDidMount() {
        // Side nav menu button trigger
        const sidenav = document.querySelectorAll('#sideNav');
        M.Sidenav.init(sidenav, {});
        this.props.dispatch(GetPersonalInfo());
    }

    render() {
        // Extracting data from redux store
        const {firstName, lastName, email, websiteLogoField, personalImageField} = this.props.personalInfo;
        return (
            // HTML here
            <div>
                <nav>
                    <div className="nav-wrapper">
                        <a href='#' data-target="sideNav" className="sidenav-trigger show-on-large">
                            <i className="valign-wrapper">
                                <MdMenu/>
                            </i>
                        </a>
                    </div>
                </nav>

                <ul className="sidenav" id="sideNav">
                    <li>
                        <div className="user-view">
                            <div className="background">
                                <img alt='person'
                                     src={axios.defaults.baseURL + personalImageField.url}/>
                            </div>
                            <img alt='initials' className="circle"
                                 src={axios.defaults.baseURL + websiteLogoField.url}/>
                            <span className="name white-text">{firstName + ' ' + lastName}</span>
                            <a href={'mailto:' + email} className="email white-text">{email}</a>
                        </div>
                    </li>
                    <li>
                        <NavLink to="/">
                            <i><MdHome/></i>
                            Home
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/about">
                            <i><MdInfo/></i>
                            About
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/portfolio">
                            <i><MdWork/></i>
                            Portfolio
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/contact">
                            <i><MdPhone/></i>
                            Contact
                        </NavLink>
                    </li>
                </ul>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return state
};

// Default export
export default connect(mapStateToProps, personalInfo)(Nav);
